import React from 'react'; 
import { Container, Jumbotron, Row } from 'react-bootstrap';

function Hero()
{


    return (
   <Jumbotron>
   <Container>
    <Row>
    
    <Col>
    <h2>Shaan Hossain</h2>
    </Col>
    </Row>
   
   </Container>
   </Jumbotron>
    );
}

export default Hero
